import '.c/paper.jpg';
import styled from 'styled-components'

/*
const Background = styled.div`
background: 
  repeating-linear-gradient(
    45deg, 
    #f0f0f0, 
    #f0f0f0 10px, 
    #dddddd 10px, 
    #dddddd 20px
  ),
  linear-gradient(
    to bottom, 
    #333333, 
    #555555
  );
background-size: 100% 20px, 100%;
background-attachment: fixed;
`;
*/

const Background = styled.div`
background-image: url("paper.jpg");
`;


export default Background
